import React from 'react'

 const Navbar = () => {
    return (
        <div id="header">
          
            <div className="navbarr">
                <div className="navContent">
                    <img src="../img/1.jpg" className="rounded"/>
                    <span className="mt-3">Nafiz Sheikh</span>
                    <p>Available for work</p>
                </div>
            </div>
        </div>
    )
}


export default Navbar;
